    component: Component, 
    auth: {isAuthenticated, loading}, 
    ...rest 
    }) => (
    <Route 
    {...rest} 
    render={props => 
        !sAuthenticated && !loading ? (
        <Redirect to='/login'/>
        ) : (
        <Component {...props} />
        )
      }
    />
);

PrivateRoute.propTypes = {
    auth: PropTypes.object.isRequired
}



const mapStateToProps = state => ({
    auth: state.auth
})

export default connect(mapStateToProps)(PrivateRoute)
